import React from "react";
import styled from "styled-components";
import { Chapeau, SmallSubtitle } from "../styled/typos";
import { Wrapper } from "../styled/space";
const strategicComite = props => {
  console.log(props.dataMember.map(m => m.name));
  return (
    <CustomWrapper>
      <Container>
        <Flex>
          <StrategicSubtitle>{props.subtitle}</StrategicSubtitle>
          <Hr />
        </Flex>

        <div>
          {props.dataMember.map(member => {
            return (
              <>
                <BlueChapeau>{member.name}</BlueChapeau>
                <BlackChapeau>{member.status}</BlackChapeau>
              </>
            );
          })}
        </div>
      </Container>
    </CustomWrapper>
  );
};

export default strategicComite;

const StrategicSubtitle = styled(SmallSubtitle)`
  white-space: nowrap;
  margin-right: 20px;
  margin-bottom: 40px;
`;

const Hr = styled.hr`
  width: 100%;
  border: 0.5px solid ${props => props.theme.colors.black};
  height: 1px;
`;
const CustomWrapper = styled(Wrapper)`
  background-color: ${props => props.theme.colors.white};
  ${props => props.theme.medias.mediumPlus`
     background-color: ${props => props.theme.colors.black};
    `}
`;

const Container = styled.div`
  background-color: ${props => props.theme.colors.white};
  padding-top: 300px;
  padding-bottom: 120px;
  ${props => props.theme.medias.mediumPlus`
      padding:50px 0 100px 0;
       background-color: ${props => props.theme.colors.black};
    `}
`;

const BlackChapeau = styled(Chapeau)`
  color: ${props => props.theme.colors.black};
  display: inline;
  ${props => props.theme.medias.mediumPlus`

       background-color: ${props => props.theme.colors.white};
    `}
`;
const BlueChapeau = styled(Chapeau)`
  color: ${props => props.theme.colors.blue};
  display: inline;
`;
const Flex = styled.div`
  display: flex;
`;
